import React, { useState } from 'react'
import { Alert, Button, Form } from 'react-bootstrap'
import { useSelector } from 'react-redux'
import { useNavigate } from 'react-router-dom'
import { submitImage2Database } from '../../api/submitImage2Database'
import './styles.scss'

function Images() {

    const carbs = useSelector(state => state.foods.carbs)
    const prots = useSelector(state => state.foods.prots)
    const fats = useSelector(state => state.foods.fats)

    const navigate = useNavigate()

    return (
        <div id='images'>
            <h1>Imagens</h1>

            {
                [...carbs, ...prots, ...fats].map((food) => (
                    <img className='icon' key={food} 
                    src={food} alt='food'/>
                ))
            }

        </div>
    )
}

export default Images
